// StartPage.js

import React from 'react';
import './StartPage.css'; // Import your CSS file for styling

const StartPage = () => {
  return (
    <div>
      <header>
        <img src="logo.png" alt="Logo" />
        {/* Replace "your-logo.png" with the path to your logo image */}
      </header>

      <section className="app-section">
        <div className="app-content">
          <h1>Personal Budget App</h1>
          <p>Welcome to our budgeting application. Manage your finances with ease.</p>
          {/* Add any additional content here */}
        </div>
        <div className="app-image">
          <img src="your-image.png" alt="App Image" />
          {/* Replace "your-image.png" with the path to your app image */}
        </div>
      </section>
    </div>
  );
}

export default StartPage;
